import React from 'react';
import './Logo.css';

class HamburgerMenu extends React.Component {
  render() {
    return (
      <svg width={this.props.width} height={this.props.height} viewBox="0 0 14 14" className="hamburger-menu">
        <path stroke={this.props.stroke} d="M2 4 h10 M2 7 h10 M2 10 h10" />
      </svg>
    );
  }
}

export default HamburgerMenu;
